import { Component } from "react";

class User extends Component {
    constructor(props){
        super(props);
        this.state={
            name:props.name,
            age:10 ,
            hobbies:props.hobbbies,
            qualification:props.qualification,
            address:props.address
        }
    }
    render() {
        return (
            <div>
            <h1>My name is  {this.state.name}. My age is {this.state.age}.</h1>
            <img src={this.props.image} width={100} height={150} 
            alt="Image not found"/>
            My hobbies are <ul>{Array.from(this.state.hobbies).map(
                item => (<li>{item}</li>    )
            )
                }
                </ul>
            <h3>My qualification is {this.props.qualification}.</h3>
            <h3>I am from {this.props.address}.</h3>
            </div>
        )
    }
}
        
export default User;
